import React from "react";
import { FiDownload, FiMail, FiGithub, FiLinkedin } from "react-icons/fi";
import { motion } from "framer-motion";

const projects = [
  {
    title: "Selenium Hybrid Automation Framework",
    desc: "Hybrid framework using POM and Data-Driven approach with HTML reporting and Jenkins CI/CD integration.",
    repo: "https://github.com/iamajjayya/selenium-hybrid-framework",
    tags: ["Python", "Selenium", "Pytest", "POM", "CI/CD"],
  },
  {
    title: "API Automation Framework",
    desc: "Automated REST API testing with endpoint validation, status code checks, and response verification.",
    repo: "https://github.com/iamajjayya/api-automation",
    tags: ["Python", "Pytest", "Requests", "API"],
  },
  {
    title: "E-commerce Website",
    desc: "React-based e-commerce platform with user auth, product listing, cart, and checkout.",
    repo: "https://ecommerceajjayya.netlify.app/",
    tags: ["React.js", "REST API", "Authentication"],
  },
];

const skills = [
  "Manual Testing",
  "Functional & Regression Testing",
  "Sanity & Smoke Testing",
  "Cross-Browser Testing",
  "Bug Reporting",
  "Selenium WebDriver",
  "Python",
  "Pytest",
  "API Testing",
  "SQL",
  "HTML/CSS/JavaScript",
  "React.js",
  "Postman",
  "Git/GitHub",
  "Jira",
  "Jenkins",
  "Docker",
];

export default function App() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-blue-100 p-6 sm:p-12 font-sans text-gray-900">
      <div className="max-w-5xl mx-auto">
        {/* Header */}
        <motion.header
          initial={{ opacity: 0, y: -30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="flex flex-col sm:flex-row items-start sm:items-center justify-between mb-12 gap-4 sticky top-0 bg-blue-50 bg-opacity-90 backdrop-blur-md z-10 p-4 rounded-lg shadow-md"
        >
          <div>
            <h1 className="text-4xl font-extrabold text-blue-800 bg-gradient-to-r from-blue-700 to-blue-900 bg-clip-text text-transparent">
              Ajjayya G V — QA / Automation Tester
            </h1>
            <p className="mt-1 text-sm text-blue-700/80">
              Electronic City, Bengaluru | DOB: 05-04-2002 | 6366325113
            </p>
          </div>
          <motion.a
            whileHover={{ scale: 1.07 }}
            whileTap={{ scale: 0.95 }}
            href="/resume.pdf"
            target="_blank"
            rel="noopener noreferrer"
            className="inline-flex items-center gap-2 px-5 py-2 bg-gradient-to-r from-blue-700 to-blue-900 text-white rounded-lg shadow-lg font-semibold select-none"
          >
            <FiDownload size={20} /> Resume
          </motion.a>
        </motion.header>

        {/* Profile Summary */}
        <motion.section
          initial={{ opacity: 0, y: 40 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, delay: 0.15 }}
          className="backdrop-blur-md bg-white/70 rounded-3xl p-8 shadow-lg mb-10"
        >
          <h2 className="text-2xl font-semibold text-blue-900 mb-4">Profile Summary</h2>
          <p className="text-gray-800 leading-relaxed text-lg max-w-3xl">
            Detail-oriented QA Tester with 1 year of manual testing experience and strong
            knowledge in Python automation. Skilled in building maintainable Selenium
            automation frameworks, API testing, and integrating CI/CD pipelines using Jenkins
            and Docker. Passionate about quality and delivering robust, reliable software.
          </p>

          {/* Skills */}
          <div className="mt-6 flex flex-wrap gap-3 max-w-3xl">
            {skills.map((skill) => (
              <motion.span
                key={skill}
                whileHover={{ scale: 1.1 }}
                className="px-3 py-1 rounded-full bg-gradient-to-r from-blue-200 to-blue-300 text-blue-900 font-medium shadow-sm cursor-default select-none"
              >
                {skill}
              </motion.span>
            ))}
          </div>
        </motion.section>

        {/* Projects */}
        <motion.section
          initial={{ opacity: 0, y: 40 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, delay: 0.3 }}
          className="mb-12"
        >
          <h3 className="text-3xl font-semibold text-blue-900 mb-8">Projects</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 gap-8">
            {projects.map(({ title, desc, repo, tags }) => (
              <motion.article
                key={title}
                whileHover={{
                  scale: 1.03,
                  boxShadow: "0 15px 30px rgba(59, 130, 246, 0.3)",
                }}
                transition={{ type: "spring", stiffness: 300 }}
                className="bg-white rounded-2xl p-6 shadow-md flex flex-col justify-between hover:shadow-lg cursor-pointer"
              >
                <div>
                  <h4 className="font-semibold text-blue-800 mb-2">{title}</h4>
                  <p className="text-gray-700 mb-4">{desc}</p>
                </div>
                <div className="flex justify-between items-center flex-wrap gap-2">
                  <div className="flex flex-wrap gap-2">
                    {tags.map((tag) => (
                      <span
                        key={tag}
                        className="bg-blue-100 text-blue-800 text-xs px-3 py-1 rounded-full font-semibold"
                      >
                        {tag}
                      </span>
                    ))}
                  </div>
                  {repo && (
                    <a
                      href={repo}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-blue-700 font-semibold hover:underline flex items-center gap-1"
                    >
                      View Repo <FiGithub size={16} />
                    </a>
                  )}
                </div>
              </motion.article>
            ))}
          </div>
        </motion.section>

        {/* Footer */}
        <motion.footer
          initial={{ opacity: 0, y: 40 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, delay: 0.5 }}
          className="flex flex-col sm:flex-row items-center justify-between text-sm text-blue-700 font-medium"
        >
          <p>© {new Date().getFullYear()} Ajjayya G V — QA Automation Tester</p>
          <div className="flex gap-6 mt-4 sm:mt-0">
            <a
              href="mailto:ajjayya2002@gmail.com"
              className="hover:underline flex items-center gap-1"
              aria-label="Send Email"
            >
              <FiMail /> Email
            </a>
            <a
              href="https://github.com/iamajjayya"
              target="_blank"
              rel="noopener noreferrer"
              className="hover:underline flex items-center gap-1"
              aria-label="GitHub Profile"
            >
              <FiGithub /> GitHub
            </a>
            <a
              href="https://linkedin.com/in/ajjayya-gv"
              target="_blank"
              rel="noopener noreferrer"
              className="hover:underline flex items-center gap-1"
              aria-label="LinkedIn Profile"
            >
              <FiLinkedin /> LinkedIn
            </a>
          </div>
        </motion.footer>
      </div>
    </div>
  );
}
